// import { Grid, Text } from '@mantine/core'
import { useDisclosure } from "@mantine/hooks";
import React, { useState } from "react";
import {
  Flex,
  Stack,
  Text,
  ActionIcon,
  Drawer,
  Button,
  ColorPicker,
  Avatar,
  Group,
} from "@mantine/core";
import {
  IconCircleXFilled,
  IconHome2,
  IconUser,
  IconSearch,
  IconMessageCircle,
  IconShoppingBag,
  IconBookmark,
} from "@tabler/icons-react";

const icons = [
  { name: "IconHome2", component: <IconHome2 /> },
  { name: "IconMessageCircle", component: <IconMessageCircle /> },
  { name: "IconSearch", component: <IconSearch /> },
  { name: "IconShoppingBag", component: <IconShoppingBag /> },
  { name: "IconUser", component: <IconUser /> },
];
const blackicons = [
  { name: "IconHome2", component: <IconHome2 /> },
  { name: "IconMessageCircle", component: <IconMessageCircle /> },
  { name: "IconBookmark", component: <IconBookmark /> },
  { name: "IconUser", component: <IconUser /> },
];
const redicons = [
  { name: "IconHome2", component: <IconHome2 /> },
  { name: "IconMessageCircle", component: <IconMessageCircle /> },
  { name: "IconBookmark", component: <IconBookmark /> },
  { name: "IconUser", component: <IconUser /> },
];

const navbar = [
  <Flex
    mih={40}
    bg="dark.9"
    justify="space-around"
    align="center"
    direction="row"
    wrap="wrap"
    style={{ border: "1px solid #1b1c1b", borderRadius: "px 25px 0 0" }}
  >
    {blackicons.map((blackicon, index) => (
      <ActionIcon
        bg="black"
        radius="md"
        key={index}
        // variant={selectedBlackIcon === index ? "transparent" : ""}
        aria-label={`Icon ${blackicon.component}`}
      >
        {blackicon.component}
      </ActionIcon>
    ))}
  </Flex>,
];

const Navbar = ({ Item, SetItem, Item2, setItem2, navBar }) => {
  const handleStack1Click = () => {
    SetItem(!Item);
    navBar(navbar);
  };
  const [selectedIcon, setSelectedIcon] = useState(null);
  const [selectedBlackIcon, setSelectedBlackIcon] = useState(null);
  const [selectedRedIcon, setSelectedRedIcon] = useState(null);

  const handleIconClick = (index, component) => {
    console.log("Clicked icon :", component);
    setSelectedIcon(index);
  };

  const handleBlackIconClick = (index, component) => {
    console.log("Clicked icon :", component);
    setSelectedBlackIcon(index);
  };

  const handleRedIconClick = (index, component) => {
    console.log("Clicked icon :", component);
    setSelectedRedIcon(index);
  };

  const icons = [
    { name: "IconHome2", component: <IconHome2 /> },
    { name: "IconMessageCircle", component: <IconMessageCircle /> },
    { name: "IconSearch", component: <IconSearch /> },
    { name: "IconShoppingBag", component: <IconShoppingBag /> },
    { name: "IconUser", component: <IconUser /> },
  ];
  const blackicons = [
    { name: "IconHome2", component: <IconHome2 /> },
    { name: "IconMessageCircle", component: <IconMessageCircle /> },
    { name: "IconBookmark", component: <IconBookmark /> },
    { name: "IconUser", component: <IconUser /> },
  ];
  const redicons = [
    { name: "IconHome2", component: <IconHome2 /> },
    { name: "IconMessageCircle", component: <IconMessageCircle /> },
    { name: "IconBookmark", component: <IconBookmark /> },
    { name: "IconUser", component: <IconUser /> },
  ];

  // select for phone

  return (
    <>
      <Flex
        mih={40}
        bg="dark.9"
        justify="space-around"
        align="center"
        direction="row"
        wrap="wrap"
        style={{ border: "1px solid #1b1c1b", borderRadius: "0 0 25px 25px" }}
        onClick={handleStack1Click}
      >
        {blackicons.map((blackicon, index) => (
          <ActionIcon
            bg="black"
            radius="md"
            key={index}
            variant={selectedBlackIcon === index ? "transparent" : ""}
            aria-label={`Icon ${blackicon.component}`}
            onClick={() => handleBlackIconClick(index, blackicon)}
          >
            {blackicon.component}
          </ActionIcon>
        ))}
      </Flex>

      <Flex
        mih={40}
        bg="white"
        mt="xs"
        justify="space-around"
        align="center"
        direction="row"
        wrap="wrap"
        style={{ border: "1px solid #1b1c1b", borderRadius: "0 0 25px 25px" }}
      >
        {/* <IconHome2 />
        <IconUser />
        <IconSearch />
        <IconMessageCircle /> */}
        {redicons.map((redicon, index) => (
          <ActionIcon
            color="red"
            radius="md"
            key={index}
            variant={selectedRedIcon === index ? "" : "transparent"}
            aria-label={`Icon ${redicon.component}`}
            onClick={() => handleRedIconClick(index, redicon)}
          >
            {redicon.component}
          </ActionIcon>
        ))}
      </Flex>

      <Flex
        mih={40}
        mt="xs"
        bg="white"
        justify="space-around"
        align="center"
        direction="row"
        wrap="wrap"
        style={{ border: "1px solid #1b1c1b", borderRadius: "25px" }}
      >
        {icons.map((icon, index) => (
          <ActionIcon
            radius="xl"
            key={index}
            variant={selectedIcon === index ? "outline" : "default"}
            aria-label={`Icon ${icon.component}`}
            onClick={() => handleIconClick(index, icon)}
          >
            {/* <Avatar>{icon.component}</Avatar> */}
            {icon.component}
          </ActionIcon>
        ))}
      </Flex>
    </>
  );
};

export default Navbar;
